import React from 'react';
import * as TabsPrimitive from '@radix-ui/react-tabs';

export function Tabs({ className = "", children, ...props }) {
  return (
    <div className={className} {...props}>
      {children}
    </div>
  );
}

export function TabsList({ className = "", children, ...props }) {
  return (
    <div className={`flex ${className}`} {...props}>
      {children}
    </div>
  );
}

export function TabsTrigger({ className = "", children, ...props }) {
  return (
    <button className={`px-4 py-2 hover:bg-gray-100 ${className}`} {...props}>
      {children}
    </button>
  );
}

export function TabsContent({ className = "", children, value, ...props }) {
  return (
    <div className={className} {...props}>
      {children}
    </div>
  );
}
